response.about:
Если попытаться написать о себе не сильно обширно, то примерно это будет так:

- обожаю шоколад;
- я люблю поспать, ненавижу просыпаться по утрам;
- я человек - настроение;
- я общительная, могу найти общий язык почти с каждым;
- люблю читать;
- люблю детей;
- предпочитаю активный образ жизни;
- люблю улыбаться, дурачиться и вредничать;
- терпеть не могу людей с завышеной самооценкой;
- один мой минус - сложный характер;
